import React from 'react';
import { View, Button, StyleSheet, Linking } from 'react-native';

const App = () => {
  const handleButtonPress = (url) => {
    Linking.openURL(url);
  };

  return (
    <View style={styles.container}>
      <Button
        title="Sitio 1"
        onPress={() => handleButtonPress('https://www.sitio1.com')}
      />
      <Button
        title="Sitio 2"
        onPress={() => handleButtonPress('https://www.sitio2.com')}
      />
      <Button
        title="Sitio 3"
        onPress={() => handleButtonPress('https://www.sitio3.com')}
      />
      <Button
        title="Sitio 4"
        onPress={() => handleButtonPress('https://www.sitio4.com')}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});

export default App;
